query:
SELECT ?osmid ?distance ?loc ?tag WHERE {
  VALUES ?tag { "shop"  "department_store" "wholesale" "erotic" }
  ?osmid osmt:shop ?tag . 
  SERVICE wikibase:around { 
      ?osmid osmm:loc ?loc . 
      bd:serviceParam wikibase:center "Point(13.129121 54.085793)"^^geo:wktLiteral . 
      bd:serviceParam wikibase:radius "15" . 
      bd:serviceParam wikibase:distance ?distance .
  } 
  FILTER(?distance < 15)
}
